import { useEffect, useState } from "react";
import { Loader2 } from "lucide-react";

function AdminDashboard() {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const token = localStorage.getItem("token");

  useEffect(() => {
    fetch("http://localhost:4000/api/admin/orders", {
      headers: { Authorization: `Bearer ${token}` },
    })
      .then((res) => res.json())
      .then((data) => {
        if (Array.isArray(data)) {
          setOrders(data);
        } else {
          setOrders([]);
        }
        setLoading(false);
      })
      .catch((err) => {
        console.error("Admin fetch error:", err);
        setLoading(false);
      });
  }, [token]);

  if (loading) {
    return (
      <div className="flex justify-center items-center h-screen">
        <Loader2 className="animate-spin w-8 h-8 text-indigo-600" />
        <span className="ml-2 text-lg">Loading Orders...</span>
      </div>
    );
  }

  return (
    <div className="p-8 bg-gray-100 min-h-screen">
      <h1 className="text-3xl font-bold mb-6 text-gray-800">ðŸ“¦ Admin Dashboard</h1>

      {orders.length === 0 ? (
        <div className="bg-white p-6 rounded-xl shadow text-center text-gray-500">
          No orders found.
        </div>
      ) : (
        <div className="overflow-x-auto bg-white p-6 rounded-xl shadow">
          <table className="min-w-full border-collapse">
            <thead>
              <tr className="bg-indigo-600 text-white">
                <th className="p-3 text-left">Customer ID</th>
                <th className="p-3 text-left">Name</th>
                <th className="p-3 text-left">Email</th>
                <th className="p-3 text-left">Mobile</th>
                <th className="p-3 text-left">Address</th>
                <th className="p-3 text-left">Products</th>
                <th className="p-3 text-left">Total Bill</th>
                <th className="p-3 text-left">Session ID</th>
                <th className="p-3 text-left">Date</th>
              </tr>
            </thead>
            <tbody>
              {orders.map((o, idx) => (
                <tr
                  key={o._id}
                  className={idx % 2 === 0 ? "bg-gray-50" : "bg-white"}
                >
                  <td className="p-3">{o.userId}</td>
                  <td className="p-3 font-medium">{o.customerName}</td>
                  <td className="p-3">{o.customerEmail}</td>
                  <td className="p-3">{o.customerPhone}</td>
                  <td className="p-3">
                    {o.customerAddress?.line1}, {o.customerAddress?.city},{" "}
                    {o.customerAddress?.postal_code}
                  </td>
                  <td className="p-3 text-sm">
                    {Array.isArray(o.items) &&
                      o.items.map((p, i) => (
                        <div key={i} className="text-gray-700">
                          {p.name} (x{p.quantity}) â€“{" "}
                          <span className="font-semibold">â‚¹{p.price}</span>
                        </div>
                      ))}
                  </td>
                  <td className="p-3 font-semibold text-indigo-600">
                    â‚¹{o.totalAmount}
                  </td>
                  <td className="p-3 text-xs text-gray-500">{o.stripeSessionId}</td>
                  <td className="p-3">
                    {new Date(o.createdAt).toLocaleString()}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}

export default AdminDashboard;
